import React, { useState } from 'react';

function Search() {
    const [search, setSearch] = useState('');

    function handleSearch(e) {
        setSearch(e.target.value);
    }

    return (
        <div>
            <form>
                <input 
                    type='text'
                    name='search'
                    placeholder='search'
                    value={search}
                    onChange={handleSearch}
                    />
            </form>
        </div>
    );
}

export default Search;
